import Card from '../Card/Card.jsx';
import style from './Cards.module.css';

export default function Cards(props) {
   const { characters, onClose } = props;
   let i = 0;
   return <div className={style.Cartas}>
      {characters.map((e) => (
          <Card 
          name={e.name}
          species={e.species}
          gender={e.gender} 
          image={e.image} 
          onClose={() => props.onClose(e.id)}
          key={i++}
          />
          ))}
   </div>;
}
